import React from "react";
import styles from "../CSS/loginstyle.module.css";
import logo from "../Images/로고.png";

export const Login = () => {
  return (
    <div className={styles.div_signin}>
      <img className={styles.main_logo} src={logo} alt="메인 로고" />
      <p className={styles.notice}>로그인 하세요</p>
      <input
        type="email"
        id="inputEmail"
        className={styles.div_input}
        placeholder="Email address"
      />
      <input
        type="password"
        id="inputPassword"
        className={styles.div_input}
        placeholder="Password"
      />
      <br />
      <button className={styles.button} type="submit">
        로그인
      </button>
      <br />
      <a href="" id={styles.div_signup} target="_">
        회원가입
      </a>
      <p className={styles.copyright}>&copy; 연세대학교 데이터베이스 14팀</p>
    </div>
  );
};
